import React from "react";
import head from "next/head";
import AppLayout from "../components/AppLayout";

const Signup = () => {
  return (
    <>
      <head>
        <meta charSet="utf-8" />
        <title>회원가입</title>
      </head>
      <AppLayout>회원등록 페이지</AppLayout>
    </>
  );
};

export default Signup;
